import React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import MenuIcon from '@mui/icons-material/Menu';
import { Link } from 'react-router-dom';
import { styled } from '@mui/material/styles';
import SpaceDashboardIcon from '@mui/icons-material/SpaceDashboard';
import CategoryIcon from '@mui/icons-material/Category';
import ControlPointDuplicateIcon from '@mui/icons-material/ControlPointDuplicate';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';
import MeetingRoomIcon from '@mui/icons-material/MeetingRoom';

const drawerWidth = 260;
const primaryColor = "#1E3A8A";
const secondaryColor = "#FACC15";

const StyledAppBar = styled(AppBar)({
  backgroundColor: primaryColor,
});

const StyledDrawer = styled(Drawer)({
  '& .MuiDrawer-paper': {
    backgroundColor: '#1E293B',
    color: '#FFFFFF',
    width: drawerWidth,
  },
});

const StyledListItemButton = styled(ListItemButton)({
  '&:hover': {
    backgroundColor: secondaryColor,
    color: '#000',
  },
});

const menuItems = [
  { name: 'Dashboard', path: '/dashboard', icon: <SpaceDashboardIcon /> },
  { name: 'Category', path: '/category', icon: <CategoryIcon /> },
  { name: 'SubCategory', path: '/subcategory', icon: <ControlPointDuplicateIcon /> },
  { name: 'Q&A', path: '/qa', icon: <HelpOutlineIcon /> },
];

const InterviewPortal = ({ children }) => {
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <div>
      <Toolbar sx={{ backgroundColor: primaryColor, color: 'white' }}>
        <Typography variant="h6">Interview Portal</Typography>
      </Toolbar>
      <Divider />
      <List>
        {menuItems.map((item, index) => (
          <Link key={index} to={item.path} style={{ textDecoration: 'none', color: 'inherit' }}>
            <ListItem disablePadding>
              <StyledListItemButton>
                <ListItemIcon sx={{ color: 'inherit' }}>{item.icon}</ListItemIcon>
                <ListItemText primary={item.name} />
              </StyledListItemButton>
            </ListItem>
          </Link>
        ))}
      </List>
      <Divider />
    </div>
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <StyledAppBar position="fixed" sx={{ width: { sm: `calc(100% - ${drawerWidth}px)` }, ml: { sm: `${drawerWidth}px` } }}>
        <Toolbar sx={{ justifyContent: 'space-between' }}>
          <IconButton color="inherit" aria-label="open drawer" edge="start" onClick={handleDrawerToggle} sx={{ mr: 2, display: { sm: 'none' } }}>
            <MenuIcon />
          </IconButton>
          <Typography variant="h6">Dashboard</Typography>
          <MeetingRoomIcon />
        </Toolbar>
      </StyledAppBar>
      <Box component="nav" sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}>
        <StyledDrawer variant="temporary" open={mobileOpen} onClose={handleDrawerToggle} ModalProps={{ keepMounted: true }} sx={{ display: { xs: 'block', sm: 'none' } }}>
          {drawer}
        </StyledDrawer>
        <StyledDrawer variant="permanent" sx={{ display: { xs: 'none', sm: 'block' } }} open>
          {drawer}
        </StyledDrawer>
      </Box>
      <Box component="main" sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}>
        <Toolbar />
        {children}
      </Box>
    </Box>
  );
};

InterviewPortal.propTypes = {
  children: PropTypes.node,
};

export default InterviewPortal;
